struct VSC_vbe*
VSC_vbe_New(struct vsmw_cluster *vc,
    struct vsc_seg **sg, const char *fmt, ...)
{
	va_list ap;
	struct VSC_vbe *retval;

	va_start(ap, fmt);
	retval = VRT_VSC_Alloc(vc, sg, vsc_vbe_name, VSC_vbe_size,
	    vsc_vbe_json, sizeof vsc_vbe_json, fmt, ap);
	va_end(ap);
	return(retval);
}

void
VSC_vbe_Destroy(struct vsc_seg **sg)
{
	struct vsc_seg *p;

	AN(sg);
	p = *sg;
	*sg = NULL;
	VRT_VSC_Destroy(vsc_vbe_name, p);
}
